import { makeStyles } from "@material-ui/core/styles";
import { themes, Icon } from '../../themes/index';

export default makeStyles(() => ({
    container:{
        backgroundColor: themes.palette.primary.main,
        color: themes.palette.secondary.dark,
        marginBottom: 0,
        fontWeight: 'lighter',
        padding:0,
    },
    button:{
        backgroundColor: themes.palette.primary.main,
        color: themes.palette.secondary.dark,
        marginTop:-70,
        fontWeight: 'lighter',
        padding: 0,
    }
}))
